    <style>
      body {
        background: linear-gradient(45deg, #55fff9, #f737cd, #c8f772de, #393cff, #1dfa30);
        background-size: 400% 400%;
        animation: gradient 10s ease infinite;
        font-family: Arial, sans-serif;
      }

      @keyframes gradient {
        0% {
          background-position: 0% 50%;
        }
        50% {
          background-position: 100% 50%;
        }
        100% {
          background-position: 0% 50%;
        }
      }

      .container {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        height: 100vh;
      }

      h1 {
        font-size: 3rem;
        margin: 2rem 0;
        text-align: center;
      }
      .button {
        background-color: #0717ff;
        border: none;
        color: white;
        padding: 2rem 4rem;
        text-align: center;
        text-decoration: burlywood ;
        display: inline-block;
        font-size: 2.5rem;
        margin-top: 2rem;
        cursor: pointer;
        border-radius: 50px;
        animation: shake 2s ease-in-out infinite;
      }

      .button:hover {
        background-color: #07e219;
      }

      @keyframes shake {
        0% {
          transform: translate(0, 0);
        }

        25% {
          transform: translate(5px, 5px);
        }

        50% {
          transform: translate(0, 10px);
        }

        75% {
          transform: translate(-5px, 5px);
        }

        100% {
          transform: translate(0, 0);
        }
      }

      @keyframes gradient {
        0% {
          background-position: 0% 50%;
        }

        50% {
          background-position: 100% 0%;
        }

        100% {
          background-position: 0% 50%;
        }
      }
    </style>
